issue.body:
The public API org.mockito.plugins.InstantiatorProvider#getInstantiator returns an Instantiator object that is an internal type. This PR exposes public API for InstantiatorProvider plugin.

```
public interface InstantiatorProvider2 {
    Instantiator getInstantiator(MockCreationSettings<?> settings);
}
```

In order to preserve backwards compatibility, we need to introduce new ```InstantiatorProvider2``` public interface. Previous ```InstantiatorProvider``` is still supported but the new type takes precedence in case both plugins are found on the classpath. For more information, see the Javadoc.

Fixes #1303
